import React from 'react';
import { useHistory } from 'react-router-dom';

const Home = ({ handleOptionChangeQ2 }) => {
  const history = useHistory();

  const handleSubmit = (event) => {
    event.preventDefault();
    const formData = new FormData(event.target);
    const selectedOptionQ2 = formData.get('q2');
    handleOptionChangeQ2({ target: { value: selectedOptionQ2 } });
    history.push('/mode-choice');
  };

  return (
    <div>
      <h1>Home</h1>
      <form onSubmit={handleSubmit}>
        <h2>Question 2:</h2>
        <label>
          <input type="radio" name="q2" value="< 5 km" /> &lt; 5 km
        </label>
        <label>
          <input type="radio" name="q2" value="> 5 km" /> &gt; 5 km
        </label>
        <br />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default Home;
